Nobel laureate Steven Weinberg has written that &quot;all that has happened since 1687 is a gloss on the Principia.&quot; Now you too can appreciate the significance of this stellar work, regarded by many as the greatest scientific contribution of all time. Despite its dazzling reputation, Isaac Newton's Philosophiae Naturalis Principia Mathematica, or simply the Principia, remains a mystery for many people. Few of even the most intellectually curious readers, including professional scientists and mathematicians, have actually looked in the Principia or appreciate its contents. Mathematician Pask seeks to remedy this deficit in this accessible guided tour through Newton's masterpiece.
